读取,具体特性请看JsonParser.Feature，一般无需设置默认即可\r\n    parser:\r\n      ALLOW_SINGLE_QUOTES: true # 是否允许出现单引号,默认false\r\n    # 枚举类JsonGenerator.Feature枚举类中的枚举属性为key，值为boolean设置jackson JsonGenerator特性，一般无需设置默认即可\r\n    # JsonGenerator在jackson中负责编写json内容,具体特性请看JsonGenerator.Feature\r\n','01b9f67b00879b2f44aebf7382b0ecee','2020-11-27 01:25:22','2020-11-27 01:25:22',NULL,'127.0.0.1','','ed63a92c-9b8c-4169-9a60-bc19059ae061',NULL,NULL,NULL,'yaml',NULL),(26,'mybatis-plus-config.properties','DEFAULT_GROUP','#mybatis plus 设置\r\nmybatis-plus.mapper-locations=classpath:/mapper/*Mapper.xml\r\n#实体扫描，多个package用逗号或者分号分隔\r\nmybatis-plus.typeAliasesPackage=pers.lbf.yeju.common.domain.entity\r\n#主键类型  0:\"数据库ID自增\", 1:\"用户输入ID\",2:\"全局唯一ID (数字类型唯一ID)\", 3:\"全局唯一ID UUID\";\r\nmybatis-plus.global-config.id-type=2\r\n#字段策略 0:\"忽略判断\",1:\"非 NULL 判断\"),2:\"非空判断\"\r\nmybatis-plus.global-config.field-strategy=2\r\n#驼峰下划线转换\r\nmybatis-plus.global-config.db-column-underline=true\r\n#刷新mapper 调试神器\r\nmybatis-plus.global-config.refresh-mapper=true\r\n#数据库大写下划线转换\r\n#mybatis-plus.global-config.capital-mode=true\r\n#序列接口实现类配置\r\n#mybatis-plus.global-config.key-generator=com.baomidou.springboot.xxx\r\n#逻辑删除配置\r\nmybatis-plus.global-config.logic-delete-value=1\r\nmybatis-plus.global-config.logic-not-delete-value=0\r\n#自定义填充策略接口实现\r\n#mybatis-plus.global-config.meta-object-handler=com.baomidou.springboot.xxx\r\n#自定义SQL注入器\r\n#mybatis-plus.global-config.sql-injector=com.baomidou.springboot.xxx\r\nmybatis-plus.configuration.map-underscore-to-camel-case=true\r\nmybatis-plus.configuration.cache-enabled=false','eeae79fcf3ddbe6f7f7a81f114d69b3e','2020-11-29 13:04:22','2020-12-13 02:40:37',NULL,'127.0.0.1','','ed63a92c-9b8c-4169-9a60-bc19059ae061','','','','properties',''),(27,'log-config.xml','DEFAULT_GROUP','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<configuration>\r\n    <!-- %m输出的信息,%p日志级别,%t线程名,%d日期,%c类的全名,%i索引【从数字0开始递增】,,, -->\r\n    <!-- appender是configuration的子节点，是负责写日志的组件。 -->\r\n    <!-- ConsoleAppender：把日志输出到控制台 -->\r\n    <appender name=\"STDOUT\" class=\"ch.qos.logback.core.ConsoleAppender\">\r\n        <encoder>\r\n            <pattern>%d %p (%file:%line\\)- %m%n</pattern>\r\n            <!-- 控制台也要使用UTF-8，不要使用GBK，否则会中文乱码 -->\r\n            <charset>UTF-8</charset>\r\n        </encoder>\r\n    </appender>\r\n    <!-- RollingFileAppender：滚动记录文件，先将日志记录到指定文件，当符合某个条件时，将日志记录到其他文件 -->\r\n    <!-- 以下的大概意思是：1.先按日期存日志，日期变了，将前一天的日志文件名重命名为XXX%日期%索引，新的日志仍然是demo.log -->\r\n    <!--             2.如果日期没有发生变化，但是当前日志的文件大小超过1KB时，对当前日志进行分割 重命名-->\r\n    <appender name=\"demolog\" class=\"ch.qos.logback.core.rolling.RollingFileAppender\">\r\n        <File>./log/yeju.log</File>\r\n        <!-- rollingPolicy:当发生滚动时，决定 RollingFileAppender 的行为，涉及文件移动和重命名。 -->\r\n        <!-- TimeBasedRollingPolicy： 最常用的滚动策略，它根据时间来制定滚动策略，既负责滚动也负责出发滚动 -->\r\n        <rollingPolicy class=\"ch.qos.logback.core.rolling.TimeBasedRollingPolicy\">\r\n            <!-- 活动文件的名字会根据fileNamePattern的值，每隔一段时间改变一次 -->\r\n            <!-- 文件名：log/demo.2017-12-05.0.log -->\r\n            <fileNamePattern>./yeju.%d.%i.log</fileNamePattern>\r\n            <!-- 每产生一个日志文件，该日志文件的保存期限为30天 -->\r\n            <maxHistory>30</maxHistory>\r\n            <timeBasedFileNamingAndTriggeringPolicy  class=\"ch.qos.logback.core.rolling.SizeAndTimeBasedFNATP\">\r\n                <!-- maxFileSize:这是活动文件的大小，默认值是10MB，测试时可改成1KB看效果 -->\r\n                <maxFileSize>2MB</maxFileSize>\r\n            </timeBasedFileNamingAndTriggeringPolicy>\r\n        </rollingPolicy>\r\n        <encoder>\r\n            <!-- pattern节点，用来设置日志的输入格式 -->\r\n            <pattern>\r\n                %d %p (%file:%line\\)- %m%n\r\n            </pattern>\r\n            <!-- 记录日志的编码:此处设置字符集 - -->\r\n            <charset>UTF-8</charset>\r\n        </encoder>\r\n    </appender>\r\n    <!-- 控制台输出日志级别 -->\r\n    <root level=\"debug\">\r\n        <appender-ref ref=\"STDOUT\" />\r\n    </root>\r\n    <!-- 指定项目中某个包，当有日志操作行为时的日志记录级别 -->\r\n    <!-- pers.lbf为根包，也就是只要是发生在这个根包下面的所有日志操作行为的权限都是DEBUG -->\r\n    <!-- 级别依次为【从高到低】：FATAL > ERROR > WARN > INFO > DEBUG > TRACE  -->\r\n    <logger name=\"pers.lbf\" level=\"DEBUG\">\r\n        <appender-ref ref=\"demolog\" />\r\n    </logger>\r\n</configuration>\r\n','7527d3bf58b1d28eebd218da0785e244','2020-11-29 13:06:37','2020-11-29 13:06:37',NULL,'127.0.0.1','','ed63a92c-9b8c-4169-9a60-bc19059ae061',NULL,NULL,NULL,'xml',NULL),(28,'mysql-datasource-dev.properties','DEFAULT_GROUP','spring.datasource.driver-class-name=com.alibaba.druid.proxy.DruidDriver\r\nspring.datasource.password=yeju@20200306\r\nspring.datasource.username=yeju\r\nspring.datasource.url=jdbc:mysql://8.129.77.225:3388/yeju_core?userSSL=false&serverTimezone=GMT%2B8\r\nspring.datasource.druid.db-type=com.alibaba.druid.pool.DruidDataSource\r\nspring.datasource.druid.driver-class-name=com.mysql.cj.jdbc.Driver\r\nspring.datasource.druid.initial-size=1\r\nspring.datasource.druid.min-idle=1\r\nspring.datasource.druid.max-active=10\r\nspring.datasource.druid.max-wait=3000\r\nspring.datasource.druid.validation-query= select now()\r\nspring.datasource.druid.filter.wall.enabled=true\r\nspring.datasource.druid.filter.wall.db-type=mysql\r\nspring.datasource.druid.filter.wall.config.delete-allow=false\r\nspring.datasource.druid.filter.wall.config.drop-table-allow=false\r\nspring.datasource.druid.filter.wall.config.multi-statement-allow=true\r\nspring.datasource.druid.filter.stat.slow-sql-millis=3000\r\nspring.datasource.druid.filter.stat.enabled=true\r\nspring.datasource.druid.filter.stat.db-type=mysql\r\nspring.datasource.druid.filter.stat.log-slow-sql=true\r\nspring.datasource.druid.filter.stat.merge-sql=true\r\nspring.datasource.druid.filter.stat.connection-stack-trace-enable=true','3ff53c00d3af02b18e012c5728ff0bae','2020-11-29 13:32:57','2021-01-02 16:06:53',NULL,'112.67.90.162','','ed63a92c-9b8c-4169-9a60-bc19059ae061','','','','properties',''),(34,'log4j.properties','DEFAULT_GROUP','log4j.rootLogger=DEBUG,console,dailyFile,rollingFile,logFile\r\nlog4j.additivity.org.apache=true\r\n# 控制台(console)\r\nlog4j.appender.console=org.apache.log4j.ConsoleAppender\r\nlog4j.appender.console.Threshold=info\r\nlog4j.appender.console.ImmediateFlush=true\r\nlog4j.appender.console.Target=System.err\r\nlog4j.appender.console.layout=org.apache.log4j.PatternLayout\r\nlog4j.appender.console.layout.ConversionPattern=%d{yyyy-MM-dd HH:mm:ss} [%p] %m%n\r\n# 日志文件(logFile)\r\nlog4j.appender.logFile=org.apache.log4j.FileAppender\r\nlog4j.appender.logFile.Threshold=info\r\nlog4j.appender.logFile.ImmediateFlush=true\r\nlog4j.appender.logFile.Append=true\r\nlog4j.appender.logFile.File=./logs/yeju.log\r\nlog4j.appender.logFile.layout=org.apache.log4j.PatternLayout\r\nlog4j.appender.logFile.layout.ConversionPattern=%d{yyyy-MM-dd HH:mm:ss} [%p] %m%n\r\n# 滚动文件(rollingFile)\r\nlog4j.appender.rollingFile=org.apache.log4j.RollingFileAppender\r\nlog4j.appender.rollingFile.Threshold=info\r\nlog4j.appender.rollingFile.ImmediateFlush=true\r\nlog4j.appender.rollingFile.Append=true\r\nlog4j.appender.rollingFile.File=./logs/yeju.log\r\nlog4j.appender.rollingFile.MaxFileSize=1024KB\r\nlog4j.appender.rollingFile.MaxBackupIndex=50\r\nlog4j.appender.rollingFile.layout=org.apache.log4j.PatternLayout\r\nlog4j.appender.rollingFile.layout.ConversionPattern=%d{yyyy-MM-dd HH:mm:ss} [%p] %m%n\r\n# 定期滚动日志文件(dailyFile)\r\nlog4j.appender.dailyFile=org.apache.log4j.DailyRollingFileAppender\r\nlog4j.appender.dailyFile.Threshold=info\r\nlog4j.appender.dailyFile.ImmediateFlush=true\r\nlog4j.appender.dailyFile.Append=true\r\nlog4j.appender.dailyFile.File=./logs/yeju.log\r\nlog4j.appender.dailyFile.DatePattern=\'.\'yyyy-MM-dd\r\nlog4j.appender.dailyFile.layout=org.apache.log4j.PatternLayout\r\nlog4j.appender.dailyFile.layout.ConversionPattern=%d{yyyy-MM-dd HH:mm:ss} [%p] %m%n','a646984ad095c1e8d4b1ca6b0e72fae7','2020-11-29 13:48:30','2020-11-29 13:50:16',NULL,'127.0.0.1','','ed63a92c-9b8c-4169-9a60-bc19059ae061','','','','properties',''),(77,'jackson-config.properties','DEFAULT_GROUP','# 设置属性命名策略,对应jackson下PropertyNamingStrategy中的常量值，SNAKE_CASE-返回的json驼峰式转下划线，json body下划线传到后端自动转驼峰式\r\nspring.jackson.property-naming-strategy=SNAKE_CASE\r\n# 全局设置@JsonFormat的格式pattern\r\nspring.jackson.date-format=yyyy-MM-dd HH:mm:ss\r\n# 当地时区\r\nspring.jackson.locale=zh\r\n# 设置全局时区\r\nspring.jackson.time-zone=GMT+8\r\n#不为空的属性才会序列化,具体属性可看JsonInclude.Include\r\nspring.jackson.default-property-inclusion=non_null\r\n# 返回的java.util.date转换成timestamp\r\nspring.jackson.serialization.write-dates-as-timestamps=false\r\n# 对象为空时是否报错，默认true\r\nspring.jackson.serialization..fail-on-empty-beans=true\r\n# 常用,json中含pojo不存在属性时是否失败报错,默认true\r\nspring.jackson.deserialization.fail-on-unknown-properties=false\r\n# 使用getter取代setter探测属性，如类中含getName()但不包含name属性与setName()，传输的vo json格式模板中依旧含name属性\r\nspring.jackson.mapper.use-getters-as-setters=true\r\n# 是否允许出现单引号,默认false\r\nspring.jackson.parser.allow-single-quotes=true\r\n','0eed057762a0be591f36ac80bf887de5','2020-11-30 03:23:59','2020-11-30 03:23:59',NULL,'127.0.0.1','','ed63a92c-9b8c-4169-9a60-bc19059ae061',NULL,NULL,NULL,'properties',NULL),(175,'redis-config-dev.properties','DEFAULT_GROUP','spring.redis.host=8.129.77.225\r\nspring.redis.port=3307\r\nspring.redis.password=hewenping\r\nspring.redis.timeout=3000\r\nspring.redis.database=1\r\nspring.redis.jedis.pool.max-active=8\r\nspring.redis.jedis.pool.max-idle=8\r\nspring.redis.jedis.pool.min-idle=3\r\n','fa1c9a8b459014d68a680538a8276d60','2020-12-06 02:57:42','2020-12-24 05:12:17',NULL,'112.67.93.206','','ed63a92c-9b8c-4169-9a60-bc19059ae061','','','','properties',''),(196,'rsa-privateKey.properties','DEFAULT_GROUP','rsa.private.path=privateKey.txt\r\nrsa.private.','32f8f2a7ffd9387fd077492758c90942','2020-12-13 16:20:03','2020-12-24 05:45:12',NULL,'112.67.93.206','','ed63a92c-9b8c-4169-9a60-bc19059ae061','','','','properties',''),(198,'rsa-publicKey.properties','DEFAULT_GROUP','rsa.public.key.path=publicKey.txt\r\nrsa.public.key.\r\n','7d7ced125a75dfc9c3be8a3a5